import React from 'react'
import Button from '@material-ui/core/Button'

const Results = (props) => {
  /*
  Results display after search. Users can click "View More" button, to
  view detail of country returned in search results.
  */

  return(
    <div>
      <h3>{props.country.name}</h3>
      <img className="flag" src={props.flag} alt=""/><br/>
      {props.authenticated && <Button variant="contained" color="primary" onClick={props.handleClick} name={props.id} type="button">Change</Button>}
      <Button variant="contained" color="primary" onClick={() => props.openCountryModal(props.country)} >View More</Button>
    </div>
)};

export default Results;
